import React from "react";
import Carousel from "react-bootstrap/Carousel";
import { Container, Row, Col } from "react-bootstrap";

const SlideComponent = () => {
  return (
    <Container>
      <Row>
        <Col>
          <Carousel interval={1000}>
            <Carousel.Item>
              <img src="https://picsum.photos/200/300" alt="First slide" />
            </Carousel.Item>
            <Carousel.Item>
              <img src="https://picsum.photos/201/300" alt="First slide" />
            </Carousel.Item>
            <Carousel.Item>
              <img src="https://picsum.photos/202/300" alt="First slide" />
            </Carousel.Item>
            <Carousel.Item>
              <img src="https://picsum.photos/203/300" alt="First slide" />
            </Carousel.Item>
          </Carousel>
        </Col>
      </Row>
    </Container>
  );
};

export default SlideComponent;
